import axios from "axios";

export const API = axios.create({
    baseURL: 'http://localhost:8080',
    headers: {
        Accept: "application/json",
    },
});

API.interceptors.response.use(
    (res) => {
        return res;
    },
    (error) => {
        if (error.response.status !== 401) {
            throw new Error(error, '12312312');
        }
    }
)
